import DefaultPics from './DefaultPics';

const CreateFromPicture = () =>{
    console.log(blank)
    return (

        <Container>
            <Row className={classes.row}>
                <Col className={classes.first}>
                    <img style={{ width: '100%' }} src={blank}></img>
                </Col>

                <Col className={classes.second}>
                    <input className={classes.input} type="text" value="Search for pictures" size="40"></input>
                    <button className={classes.searchbtn}>Search</button>
                    <DefaultPics />

                </Col>
            </Row>
            <Row className={classes.row}>
                <Col className={classes.first}>
                </Col>
                <Col>
                </Col>
            </Row>
        </Container>
    );
};
export default CreateFromPicture
